kurang lbh sprt ini

awk '
{ 
    for (i=1; i<=NF; i++)  {
        a[NR,i] = $i
    }
}
NF>p { p = NF }
END {    
    for(j=1; j<=p; j++) {
        str=a[1,j]
        for(i=2; i<=NR; i++){
            str=str" "a[i,j];
        }
        print str
    }
}' file

Full Bash. Modified from this answer: https://stackoverflow.com/a/54339179

```while read -r baris; do
  N=${#baris}
  G=${baris//|/}
  G=${#G}
  (( G = N - G ))
  echo "$baris" >> list_${G}_pipeline.txt
done < /tmp/list.txt```

